import React, { Component } from "react";
import { Link } from "react-router-dom";
import "./nav.css";
export default class Nav extends Component {
  render() {
    return (
      <nav>
        <ul>
          <Link to='/home' className='links'>
            <li>Home</li>
          </Link>
          <Link to='/login' className='links'>
            <li>About Us</li>
          </Link>
          <Link to='/login' className='links'>
            <li>Login</li>
          </Link>
        </ul>
      </nav>
    );
  }
}
